import React from 'react';
import Usuario from "../../Utils/Img/ilustraciones/users.svg";
import ReactDOM from 'react-dom';

import './cajainicio.css';

function Cajainicio() {
  return (
    <div className="cajainicio">
    <h1 id="Tittle">¿Quién eres?</h1>
      <p id="frase">Elige una de las opciones para el ingreso </p>

      <div className="Container_img">
      <img className="usuario" src={Usuario} /> 
    </div>

    <p id="frase">
        <div className="Botones">
                      <Link exact to="/">
                          <button>Acompañante </button>
                       </Link>
                 </div>
        </p>


                 <div className="Botones">
            <Link exact to="/">
                  <button> Invitado</button>
                    </Link>
                 </div>
                 <div className="Botones">
                 <Link exact to="/">
                       <button>Administrativo </button>
                         </Link>
                      </div>

</div>

   
  );
}

export default Cajainicio;
